function Search(props) {

    const styles = {
        image: {

            width: '10%',
            height: 'auto',

        },
        div: {

            display: 'flex',
            flexDirection: 'row',

        }
    }
    return (
        <>
            <h2>Duck</h2>
            <h2>Duck</h2>
            <h2>Duck</h2>
            <h2>Duck</h2>
            <h2>Goose</h2>
            <h2>Duck</h2>
            <h2>Duck</h2>
            <h2>Duck</h2>
            <h2>Duck</h2>
            <h2>Duck</h2>
            <h2>Duck</h2>

            <h2>If your prefered bird has not been added please add a sighting on our contact page</h2>

            <div style={styles.div}>
                <img style={styles.image} src="/UntitledTwo.png" alt="Yellow duck" />
                <img style={styles.image} src="/Untitled.png" alt="Yellow duck" />
            </div>

        </>
    )
}

export default Search
